import React from "react";
import NavListItem from "../components/NavListItem";
import navListData from "../data/NavListData";

function Header() {
    return(
        <div>
            <h1>Movieflix</h1>
            <ul>
                {
                    navListData.map((nav) => {
                        <NavListItem key={nav.id} name={nav.name} />
                    })
                }
            </ul>
        </div>
    )
}

export default Header;
